// Superceded by Version 4:<br />
// <a rel="nofollow" href="http://www.thingiverse.com/thing:36568" >http://www.thingiverse.com/thing:36568</a>  
// //////////////////////////////<br />
// USER PARAMETERS<br />
// //////////////////////////////  
// Pulley properties<br />
shaftDiameter = 26.289; // the shaft at the center, will be subtracted from the pulley. Better be too small than too wide.<br />
hubDiameter = 35; // if the hub or timing pulley is big enough to fit a nut, this will be embedded.<br />
hubHeight = 25; // the hub is the thick cylinder connected to the pulley to allow a set screw to go through or as a collar for a nut.<br />
flanges = 2; // the rims that keep the belt from going anywhere<br />
hubSetScrewDiameter = 7.112; // use either a set screw or nut on a shaft. Set to 0 to not use a set screw.<br />
hubSetScrewAngle = 90; //change from 90 to angle the setscrews<br />
numSetScrews = 3;<br />
numTeeth = 75; // this value together with the pitch determines the pulley diameter<br />
toothType = 3; // 1 = slightly rounded, 2 = oval sharp, 3 = square. For square, set the toothWith a little low.  
// Belt properties:<br />
pitch = 5; // distance between the teeth<br />
beltWidth = 4; // the width/height of the belt. The (vertical) size of the pulley is adapted to this.<br />
beltThickness = 0.65; // thickness of the part excluding the notch depth!<br />
notchDepth = 1.8; // make it slightly bigger than actual, there's an outward curvature in the inner solid part of the pulley<br />
toothWidth = 1.4; // Teeth of the PULLEY, that is.  
include &lt;MCAD/teardrop.scad&gt;
